import React, { useState, useEffect } from 'react';

const WazuhAgents = () => {
    const [agentsCount, setAgentsCount] = useState({
        data: {
            total: 0,
            active: 0,
            inactive: 0,
            neverConnected: 0,
        },
    });

    useEffect(() => {
        fetchData();
    }, []);

    const fetchData = async () => {
        try {
            const response = await fetch("http://localhost:3001/get-agents_count");
            const agentsCountData = await response.json();
            setAgentsCount(agentsCountData);

        } catch (error) {
            console.error(error);
        }
    };

    return (
        <div>
            <center>
                <h1>Wazuh Agents Count</h1>
                </center>
                <ul style={{display:"flex",flexDirection:"row",justifyContent:"space-around",fontSize:"20px"}} className=''>
                    <li key={1} style={{display:"flex",flexDirection:"column"}}>Total Number of Agents: {agentsCount.data[0]?.total}</li>
                    <li key={2}  style={{display:"flex",flexDirection:"column"}} >Active Agents: {agentsCount.data[0]?.active}</li>
                    <li key={3}  style={{display:"flex",flexDirection:"column"}}>Inactive Agents: {agentsCount.data[0]?.inactive}</li>
                    <li key={4} style={{display:"flex",flexDirection:"column"}}>Never Connected Agents: {agentsCount.data[0]?.never_connected}</li>
                </ul>
 
        </div>
    );
};

export default WazuhAgents;
